double sigmoid(const double & x) {

  return 1.0 / (1.0 + exp(-x));
}

double vector_mean(const std::vector<double>  & v)
  {
    return std::accumulate(v.begin(), v.end(), 0.0) / v.size();
  }

double vector_mean(const std::vector<double>  & v,const double sum)
  {
    return sum / v.size();
  }

double standard_deaviation(const std::vector<double>  &v)
  {
    double mean= vector_mean(v);
    double std=0.0;
    std::for_each(v.begin(),v.end(),[&](const double d){
      std += (d-mean)*(d-mean);
    });
    return sqrt(std/(v.size()));
  }

double standard_deaviation(const std::vector<double> &v,const double mean)
{
  double std=0.0;
  std::for_each(v.begin(),v.end(),[&](const double d){
    std =+ (d-mean)*(d-mean);
  });
  return sqrt(std/(v.size()));
}

parameters PROX_iter(const std::vector<std::vector<double>> & data, bool dichotomous=1,int PROX_MAX=10)
  {
    std::vector<double> ability = std::vector<double>(data.size(), 0.0);
    std::vector<double> difficulty = std::vector<double>(data[0].size(), 0.0);

   
    const double MAX_PERSON_SCORE =data[0].size();
    const double MAX_ITEM_SCORE = data.size();
    bool condition =true;
    int iter = 0;

    for (iter;iter<PROX_MAX;iter++)
      {
        std::cout<<ability[0]<<std::endl;
        double difficulty_average;
        double difficulty_std;
        if (iter==0)
        {
          difficulty_average=0;
          difficulty_std = 0;
        }
        else
        {
          difficulty_average = vector_mean(difficulty);
          difficulty_std = standard_deaviation(difficulty,difficulty_average);
        }
        

        double ability_const= sqrt(1+(difficulty_std*difficulty_std)/2.9);

        for (int n =0;n<ability.size();n++)
          {
            double person_n_raw_score = std::accumulate(data[n].begin(), data[n].end(), 0.0);


            if (person_n_raw_score==0)
              {
                person_n_raw_score+=1;
              } 
            else if (person_n_raw_score==MAX_PERSON_SCORE)
              {
                person_n_raw_score-=1;
              }
            
            ability[n]= difficulty_average+ability_const*log(person_n_raw_score/(MAX_PERSON_SCORE-person_n_raw_score));
          }

        double ability_average;
        double ability_std;
        if (iter==0)
        {
          ability_average=0;
          ability_std = 0;
        }
        else
        {
          ability_average = vector_mean(ability);
          ability_std = standard_deaviation(ability,ability_average);
        }

        double difficulty_const= sqrt(1+(ability_std*ability_std)/2.9);

        for (int i =0;i<difficulty.size();i+=1)
          {
            double item_i_raw_score =0.0; 
            std::for_each(data.begin(),data.end(),[&](const std::vector<double> &v){
              item_i_raw_score+= v[i];
            });

            if (item_i_raw_score==0)
              {
                item_i_raw_score++;
              } 
            else if (item_i_raw_score==MAX_ITEM_SCORE)
              {
                item_i_raw_score--;
              }
            
            difficulty[i]= ability_average - difficulty_const*log(item_i_raw_score/(MAX_ITEM_SCORE-item_i_raw_score));
          }
      }

    parameters result = {ability,difficulty};
    return result;
  }


